bundler.module('scripts/rain.js','// # Rain demo effect\x0a// Coded very minimalistic.\x0a\x0a// Setup environment / app-wrapping\x0avar running;\x0aexports.app = {\x0a    underbar: true,\x0a    type: \x27canvas\x27,\x0a    start: function() {\x0a        running = true;\x0a        // http://js1k.com/ environment.\x0a        var c = this.elem;\x0a        var a = c.getContext(\x272d\x27);\x0a\x0a        // ## Actual program\x0a\x0a        // Setup size.\x0a        var size = c.width = c.height = 256;\x0a        \x0a        // Access to canvas imagebuffer.\x0a        var image = a.getImageData(0,0,size,size);\x0a        var imageBuffer = image.data;\x0a\x0a        // Initialise height buffers.\x0a        var g = [];\x0a        var h = [];\x0a\x0a        // Start main loop function.\x0a        f();\x0a        function f() { if(running) {\x0a\x0a            // Splash a random drop.\x0a            var pos = Math.random()*size*size|0;\x0a            g[pos]=g[pos+1]=g[pos+2]=g[size+pos+1]=g[2*size+pos+1]=127;\x0a\x0a            // Swap height buffers.\x0a            var t = g; g = h; h = t;\x0a\x0a            // Propagate waves / calculate height buffer.\x0a            for(var i=0;i<size*size;++i) {\x0a                h[i] = ((g[i-1]+g[i+1]+g[i-size]+g[i+size])/2 - h[i])*0.99 || 0;\x0a\x0a                // Set alpha and color.\x0a                imageBuffer[i*4+3] = 255;\x0a                imageBuffer[i*4+2] = 255&(128+h[i]-h[i-size-1]);\x0a            }\x0a\x0a            // Blit.\x0a            a.putImageData(image,0,0);\x0a            // Repeat.\x0a            setTimeout(f, 0);\x0a        }}\x0a        // ## Cleanup code (app-wrapping)\x0a        \x0a        //\x0a    },\x0a    stop: function() {\x0a        running = false;\x0a    }\x0a};\x0a\x0a');
